    return (

        <List>
             <Text>{item.text} </Text>
        <TouchableOpacity onPress={() => pressHandler(item.key)}>

           <Ex></Ex>

        </TouchableOpacity>
        </List>
    )
}

const Text = styled.Text`
font-size: 20px;
color:red;
`
const List = styled.View`
border-radius: 20px;
border: solid black 1px;
width: 320px;
padding: 10px 0 10px 10px;
`

export default DiaryFood
